INSERT INTO `careerguidanceinfo` VALUES ('8', 'A2016', '无色的规范化', '<p>前卫的风格让他地方</p><p>啊所谓的法国海军发货的说法</p><p><img src=\"data:image/jpeg;base64,\"></p>', '2020-04-09 00:00:00', '23');
INSERT INTO `careerguidanceinfo` VALUES ('9', 'A2016', '我要就业', '<p>每当我们执行某个 SQL 发现很慢时，都会下意识地反应是否加了索引，那么大家是否有想过加了索引为啥会使数据查找更快呢，索引的底层一般又是用什么结构存储的呢，相信大家看了标题已经有答案了，没错！B+树！那么它相对于一般的链表，哈希等有何不同，为何多数存储引擎都选择使用它呢，今天我就来揭开 B+ 树的面纱，相信看了此文，B+ 树不再神秘，对你理解以下高频面试题会大有帮助！</p><ul><li>为啥索引常用 B+ 树作为底层的数据结构</li><li>除了 B+ 树索引，你还知道什么索引</li><li>为啥推荐自增 id 作为主键，自建主键不行吗</li><li>什么是页分裂，页合并</li><li>怎么根据索引查找行记录</li></ul><p>本文将会从以下几个方面来讲解 B+ 树</p><ol><li>定义问题</li><li>几种常见的数据结构对比</li><li>页分裂与页合并</li></ol><p><img src=\"data:image/jpeg;base64,\"></p>', '2020-04-12 00:00:00', '9');
INSERT INTO `careerguidanceinfo` VALUES ('10', 'A2016', '我要就业', '<p>每当我们执行某个 SQL 发现很慢时，都会下意识地反应是否加了索引，那么大家是否有想过加了索引为啥会使数据查找更快呢，索引的底层一般又是用什么结构存储的呢，相信大家看了标题已经有答案了，没错！B+树！那么它相对于一般的链表，哈希等有何不同，为何多数存储引擎都选择使用它呢，今天我就来揭开 B+ 树的面纱，相信看了此文，B+ 树不再神秘，对你理解以下高频面试题会大有帮助！</p><p><img src=\"data:image/jpeg;base64,\"></p>', '2020-04-12 00:00:00', '13');
INSERT INTO `careerguidanceinfo` VALUES ('11', 'A2016', '大学生弱势群体就业， 更应得到关注', '<p>&nbsp;	近年来，我国大学生就业问题已引起国家和全社会的高度关注，随着高校毕业生的逐年增加，每年有越来越多的大学毕业生不能及时就业，而这些没有及时就业的人群当中，绝大多数是在就业竞争中处于弱势的群体。在大学生就业形势日趋严峻的情况下，社会上存在的漠视态度和歧视行为，使大学生弱视群体无法获得平等的就业机会，被无情地剥夺了公平竞争的资格。</p><p>	大学生就业弱势群体是指大学生在就业过程中，由于主观或客观原因造成自身在就业竞争环境中处于劣势或在竞争能力上不足的群体，随着就业竞争激烈程度的上升，已演变为学校知名度、心理健康、家庭经济状况、性别、外貌、社会关系等多方面原因造成大学生在就业中出现了不同程度的弱势。随着我国高等教育由精英教育向普及教育的转变，大学生由“天之骄子”变为“平民百姓”，这使得他们在自主择业的就业背景下面临更大的竞争压力。</p><p><img src=\"data:image/png;base64,\"></p>', '2020-04-13 00:00:00', '23');
INSERT INTO `careerguidanceinfo` VALUES ('12', 'A2016', '如果我是面试官', '<p class=\"ql-align-justify\">面试题有多奇葩，你想都想不到。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">什么卫生巾啊，拉链开了啊之类的，全出来了。</p><p class=\"ql-align-justify\">但是，就算再奇葩，都比不上阿磊前段时间遇到的面试题：<strong>如果你是我，你会对自己说什么？</strong></p><p><img src=\"data:image/jpeg;base64,\"></p><p class=\"ql-align-justify\">50多人应聘，只剩下三个进入最后的面试，阿磊运气不错，赫然在其中。</p><p class=\"ql-align-justify\">面试官是一个美女，高跟鞋哒哒的，很有气势，问题也很霸气：“如果你是我，你会对自己说什么？”</p><p class=\"ql-align-justify\"><span style=\"color: rgb(153, 153, 153);\">第一个面试者，听到这个问题，想都没想：“你这意思是我面试我自己吗？这种如果有意义吗？贵公司如果是这样面试人的话，那我还是走吧！”</span></p><p class=\"ql-align-justify\">说完，他真的走了，面试官也没有挽留——<strong>这种自以为是、自视甚高的人根本不是公司需要的。</strong></p><p><img src=\"data:image/jpeg;base64,\"></p><p class=\"ql-align-justify\">第二个面试者进来了，他想了想，说：“如果我是面试官，我会问自己：你的优点和缺点分别是什么？”</p><h1 class=\"ql-align-justify\"><strong class=\"ql-size-large\">美女面试官笑了笑，问他：“为什么是这个问题？”</strong></h1><p class=\"ql-align-justify\">面试者答道：“这不是你们面试官经常问的问题吗？”</p><p class=\"ql-align-justify\">面试官点了点头：“你可以先出去了，面试结果，会在两天内电话通知你。”</p><p class=\"ql-align-justify\">那人愣了一下，心想这就完事了吗，一脸懵逼地走了出去。</p><p><img src=\"data:image/jpeg;base64,\"></p><p class=\"ql-align-justify\">最后的面试者是阿星，他进屋后警惕地看着美女，因为他注意到刚才离开的两人脸色不太好。</p><p class=\"ql-align-justify\">这时，美女面试官问了那个奇葩的问题：“如果你是面试官，你会对自己说什么？”</p><p class=\"ql-align-justify\"><strong>阿星想了想，灵机一动，答道：“如果我是面试官，我会对自己这样说：恭喜你，你被录取了！”</strong></p><p class=\"ql-align-justify\">面试官怔了一下，问他：“为什么？”</p><p class=\"ql-align-justify\"><strong>阿星：“因为我了解我自己，也了解贵公司，彼此合适！所以，如果我是面试官，我会录用我自己。如果你了解我的话，你也会这么做！”</strong></p><p><img src=\"data:image/jpeg;base64,\"></p><p class=\"ql-align-justify\">第二天，阿星接到了录用通知。</p><p class=\"ql-align-justify\">后来，他知道，面试的问题是老板出的。</p><p class=\"ql-align-justify\"><strong>其主要目的是，看看面试者会不会换位思考。</strong></p><p class=\"ql-align-justify\">而阿星虽然耍了个小聪明，但却抓住了问题的本质，直接从问题过渡到了答案，很不错。</p><p><br></p>', '2020-04-14 00:00:00', '26');
INSERT INTO `careerguidanceinfo` VALUES ('13', 'A2016', '我要就业', '<p><strong style=\"background-color: rgb(153, 204, 255);\">Cookie的诞生</strong></p><p>由于HTTP协议是无状态的，而服务器端的业务必须是要有状态的。Cookie诞生的最初目的是为了存储web中的状态信息，以方便服务器端使用。比如判断用户是否是第一次访问网站。目前最新的规范是RFC 6265，它是一个由浏览器服务器共同协作实现的规范。</p><p><strong>Cookie的处理分为：</strong></p><p>服务器像客户端发送cookie</p><p>浏览器将cookie保存</p><p>之后每次http请求浏览器都会将cookie发送给服务器端</p><p><strong style=\"background-color: rgb(153, 204, 255);\">服务器端的发送与解析</strong></p><p><strong>发送cookie</strong></p><p>服务器端像客户端发送Cookie是通过HTTP响应报文实现的，在Set-Cookie中设置需要像客户端发送的cookie，cookie格式如下：</p><p>Set-Cookie: \"name=value;domain=.domain.com;path=/;expires=Sat, 11 Jun 2016 11:29:42 GMT;HttpOnly;secure\"</p><p>其中name=value是必选项，其它都是可选项。Cookie的主要构成如下：</p><p>name:一个唯一确定的cookie名称。通常来讲cookie的名称是不区分大小写的。</p><p>value:存储在cookie中的字符串值。最好为cookie的name和value进行url编码</p><p>domain:cookie对于哪个域是有效的。所有向该域发送的请求中都会包含这个cookie信息。这个值可以包含子域(如：</p><p>yq.aliyun.com)，也可以不包含它(如：.aliyun.com，则对于aliyun.com的所有子域都有效).</p><p>path: 表示这个cookie影响到的路径，浏览器跟会根据这项配置，像指定域中匹配的路径发送cookie。</p><p><img src=\"data:image/jpeg;base64,\"></p>', '2020-04-20 00:00:00', '19');
INSERT INTO `careerguidanceinfo` VALUES ('14', 'A2016', '你要的岗位是什么', '<p class=\"ql-align-justify\">今天早会过后，阿英让我留下来，我意识到她有什么事情要对我说。我们面对面地坐了下来。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">“主管，我们家门口物业那边有在招人，因为我现在还在试用期……”</p><p class=\"ql-align-justify\">因为这第一句话，我知道了接下来的主题了。阿英要走，没有任何征兆。我只知道她不想去上海出差，我也跟她说了，这次上海她可以不去，但是作为线上销售，出差的事情，以后总是难免的。</p><p class=\"ql-align-justify\">她做决定，可能就是这几天吧！我坐在她对面，听她说了很多。阿英有2个孩子，老公和婆婆都在这边，但是对于不能照顾好孩子，她内心是很愧疚的。她甚至没有送过小的孩子去上学，讲到这里，她哭了。总之是觉得很愧疚，没能把孩子照顾好。</p><p class=\"ql-align-justify\">当初和阿英一起入职的还有另外两个人，这三个人当中，阿英是最勤奋好学的，对待客户也是很有礼貌的。这三个人当中，我最看好她，她有做客服的基础，她之前就一直在从事客服方面的工作。后来我把阿英从客服调到线上，也是想让她发挥她的特长。</p><p class=\"ql-align-justify\">我知道阿英的想法，她所要的是一份朝九晚五没有压力没有加班不会出差的工作，但是作为我们这家创业型公司，不加班不出差几乎是不可能的。我知道阿英的主要工作是照顾两个孩子，工作对她来说差不多就可以了。</p><p class=\"ql-align-justify\">听阿英说起来，两个孩子尚在她身边，她都觉得如此愧疚。这让我情何以堪，我可是把孩子放在老家让她奶奶带。不过这也是没有办法的事情。</p><p class=\"ql-align-justify\">对于员工的离职，我向来不会挽留，她如果已经决定要离职，肯定有她自己的想法。我同意了，问她是做完这个月还是什么时候走。她说也没什么要交接的，今天就可以离开。</p><p class=\"ql-align-justify\">下午三点钟的时候，阿英收拾好东西，关上电脑，和我们告别后就离开了。</p><p class=\"ql-align-justify\">曾经有一个女孩子，当别人都说她不适合的时候，我坚持让她留下来，那个时候她还有激情。几个月过后，她犯了很多错，任何人都会犯错，但是她对客户没有敬畏之心。当我们再见面的时候，她说她做完今年可能就不会做了，她要到另一个城市里去。</p><p class=\"ql-align-justify\">我赞同她的想法，如果你还年轻，就应该去做你想做的事情。同时我也觉得，如果一个人不适合一份工作，劝她留下来其实是害了她。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=4232982996,2840850000&amp;fm=173&amp;app=49&amp;f=JPEG?w=312&amp;h=208&amp;s=C1730F745D5B55C844E0E8C40300E0F2\"></p>', '2020-04-20 00:00:00', '38');

