INSERT INTO `recruitmentinfo` VALUES ('1', 'A2016', '名动软件股份有限公司', '广州明动软件股份有限公司成立于2004年12月23日，注册地位于广州市天河区白沙水路89号1-2层，法人代表为任明峰。经营范围包括软件开发;游戏设计制作;安全技术防范系统设计、施工、维修;智能卡系统工程服务;工程项目管理服务;通信系统工程服务;数字动漫制作;职业技能培训（不包括需要取得许可审批方可经营的职业技能培训项目）;楼宇设备自控系统工程服务;信息技术咨询服务;监控系统工程安装服务;信息系统集成服务;数据处理和存储服务;计算机网络系统工程服务;地理信息加工处理;广州明动软件股份有限公司对外投资4家公司，具有2处分支机构。', '前端开发工程师', '1.本科及以上学历，2年以上前端开发相关工作经验；\r2.熟练掌握多种Web前端技术，包括XHTML /CSS/JavaScript/HTML5；\r3.习惯于手写符合W3C标准、兼容多种浏览器的前端页面代码；\r4.熟练掌握Ajax、JavaScript、jQuery等前端技术，掌握面向对象编程思想；\r5.熟悉AMD、CMD、angularjs、grunt、nodejs等前端新技术优先；\r6.对前端模块化、组件化、自动化、测试等有着一定的理解和研究的优先。', '广东省广州市天河区天源路中', '4', '2020-04-25 00:02:02,2020-04-14 09:08:11', '广东省广州市天河区广东金融学院', '2222.00', 'http://www.minstone.com.cn/2015-07-22-13-07-45/2015-07-29-01-24-11/2015-07-29-05-43-23');
