INSERT INTO `recruitmentinfo` VALUES ('7', 'A2016', '名动软件股份有限公司', '广州明动软件股份有限公司成立于2004年12月23日，注册地位于广州市天河区白沙水路89号1-2层，法人代表为任明峰。经营范围包括软件开发;游戏设计制作;安全技术防范系统设计、施工、维修;智能卡系统工程服务;工程项目管理服务;通信系统工程服务;数字动漫制作;职业技能培训（不包括需要取得许可审批方可经营的职业技能培训项目）;楼宇设备自控系统工程服务;信息技术咨询服务;监控系统工程安装服务;信息系统集成服务;数据处理和存储服务;计算机网络系统工程服务;地理信息加工处理;广州明动软件股份有限公司对外投资4家公司，具有2处分支机构。', '系统集成工程师', '1. 专科及以上学历，计算机或市场营销等相关专业； \r2. 热爱销售工作，工作态度积极，责任心强； \r3. 具备销售技巧及经验、市场营销经验及渠道拓展能力者优先； \r4. 性格开朗外向，表达能力好，具有较强的沟通能力，组织、协调能力和团队管理能力； \r5. 具备较强的事业心与责任心。', '广东省广州市天河区天源路中', '1', '2020-04-27 00:02:02,2020-04-14 09:08:11', '广东省广州市天河区广东金融学院', '9000.00', 'http://www.minstone.com.cn/2015-07-22-13-07-45/2015-07-29-01-24-11/2015-07-29-05-43-23');
INSERT INTO `recruitmentinfo` VALUES ('9', 'A2016', '名动软件股份有限公司', '广州明动软件股份有限公司成立于2004年12月23日，注册地位于广州市天河区白沙水路89号1-2层，法人代表为任明峰。经营范围包括软件开发;游戏设计制作;安全技术防范系统设计、施工、维修;智能卡系统工程服务;工程项目管理服务;通信系统工程服务;数字动漫制作;职业技能培训（不包括需要取得许可审批方可经营的职业技能培训项目）;楼宇设备自控系统工程服务;信息技术咨询服务;监控系统工程安装服务;信息系统集成服务;数据处理和存储服务;计算机网络系统工程服务;地理信息加工处理;广州明动软件股份有限公司对外投资4家公司，具有2处分支机构。', '运维工程师', '1、熟悉Linux（Centos系统）的操作、管理和日常维护及精通Nginx、Tomcat、redis、等应用的安装配置管理；\r2、熟悉mysql、oracle数据库，包括安装、备份、主从复制等；\r3、具备mysql、oracle数据库集群搭建能力；\r4、熟悉Jenkins、Git、kubernetes/docker；\r5、对docker/Ansible/自动化运维方向感兴趣。', '广东省广州市天河区天源路中', '3', '2020-04-02 00:02:02,2020-04-14 09:08:11', '广东省广州市天河区广东金融学院', '90000.00', 'http://www.minstone.com.cn/2015-07-22-13-07-45/2015-07-29-01-24-11/2015-07-29-05-43-23');
INSERT INTO `recruitmentinfo` VALUES ('10', 'A2016', '广东明动软件股份有限公司', '广州明动软件股份有限公司成立于2004年12月23日，注册地位于广州市天河区白沙水路89号1-2层，法人代表为任明峰。经营范围包括软件开发;游戏设计制作;安全技术防范系统设计、施工、维修;智能卡系统工程服务;工程项目管理服务;通信系统工程服务;数字动漫制作;职业技能培训（不包括需要取得许可审批方可经营的职业技能培训项目）;楼宇设备自控系统工程服务;信息技术咨询服务;监控系统工程安装服务;信息系统集成服务;数据处理和存储服务;计算机网络系统工程服务;地理信息加工处理;广州明动软件股份有限公司对外投资4家公司，具有2处分支机构。', '测试工程师', '1. 计算机或相关专业，本科及以上学历；\n2. 熟悉软件测试流程及编写相关测试文档；\n3. 熟悉至少一种自动化测试工具和一门脚本开发的语言；\n4. 熟悉数据库软件Oracle、Mysql，能写SQL语句；\n5. 熟悉WEB服务器软件Weblogic、Tomcat等安装配置。', '广州市天河区白沙水路89号1-2层', '5', '2020-04-15 00:00:00,2020-04-16 00:00:00', '广东工业大学实验楼一楼大厅', '10000.00', 'http://www.minstone.com.cn/2015-07-22-13-07-45/2015-07-29-01-24-11/2015-07-29-05-43-23');

-- ----------------------------
-- Table structure for studentinfo
-- ----------------------------
DROP TABLE IF EXISTS `studentinfo`;
CREATE TABLE `studentinfo` (
  `id` int(11) NOT NULL auto_increment,
  `stuNo` varchar(255) collate utf8_unicode_ci NOT NULL,
  `classNo` varchar(255) collate utf8_unicode_ci NOT NULL,
  `stuName` varchar(255) collate utf8_unicode_ci default NULL,
  `stuSex` varchar(255) collate utf8_unicode_ci default NULL,
  `idCard` varchar(255) collate utf8_unicode_ci default NULL,
  `education` varchar(255) collate utf8_unicode_ci default NULL,
  `politicalStatus` varchar(255) collate utf8_unicode_ci default NULL,
  `biogenicLand` varchar(255) collate utf8_unicode_ci default NULL,
  `graduationTime` datetime default NULL,
  `stuTel` varchar(255) collate utf8_unicode_ci default NULL,
  `familyContact` varchar(255) collate utf8_unicode_ci default NULL,
  `homeTel` varchar(255) collate utf8_unicode_ci default NULL,
  `homeAddress` varchar(255) collate utf8_unicode_ci default NULL,
  PRIMARY KEY  (`id`),
  KEY `stuNo` (`stuNo`),
  KEY `classNo` (`classNo`),
  CONSTRAINT `studentinfo_ibfk_1` FOREIGN KEY (`stuNo`) REFERENCES `userinfo` (`userId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `studentinfo_ibfk_2` FOREIGN KEY (`classNo`) REFERENCES `classinfo` (`classNo`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='InnoDB free: 3072 kB; (`stuNo`) REFER `employmanager/userinf';

